import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./main.css";
import logo from './img/ig-logo-1.png';

export default class Navbar extends Component {
  render() {
    return (
      <nav className="navbar navbar-expand-lg navcol ">
        <Link to="/" className="logo ml-3" >
          Innovation Garage
        </Link>
      console.log(logo);


        <div class="navbar-collapse collapse w-100 order-3 dual-collapse2">
          <ul class="navbar-nav ml-auto">
            <li class="nav-item">
              <Link to="/" className=" ">
                Home
              </Link>
            </li>
            <li class="nav-item">
              <Link to="/innovations" className=" ">
                Innovations
              </Link>
            </li>
            <li class="nav-item">
              <Link to="/about" className=" ">
                About Us
              </Link>
            </li>
            <li class="nav-item">
              <Link to="/contact" className=" ">
                Contact
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}
